function filterCars(subcategory, setCars) {
return fetch("http://localhost:3001/cars.json")
    .then((res) => res.json())
    .then((data) => {
    if (Array.isArray(data.cars)) {
        const result = data.cars.filter((curData) => {
        return curData.seats === subcategory;
        });
        setCars(result);
    } else {
        console.error("Fetched data is not an array:", data);
    }
    })
    .catch((error) => {
    console.error("Error fetching car.json:", error);
    });
}

export default filterCars;
